    },
    {
      "$state": {
        "store": "appState"
      },
      "meta": {
        "alias": "Bots",
        "disabled": false,
        "index": "git",
        "key": "author_bot",
        "negate": true,
        "value": "true"
      },
      "query": {
        "match": {
          "author_bot": {
            "query": 1,
            "type": "phrase"
          }
        }
      }
